var midi = null;

$(function() {

  function loadPatch(patchNumber){
    var patchNameElement = document.getElementsByName("patch_name").item(0);
    var patchData = patches[patchNumber];
    var tmp = [];

    for(var i = 0; i < 13; i = i + 1) {
      tmp.push( String.fromCharCode(patchData[i]) );
    }
    patchNameElement.value = tmp.join("");

    for(var i = 13; i < 238; i++){
      var input = document.querySelectorAll("[data-id='"+i+"']");
      if(input != undefined && input.item(0) != null){
        input.item(0).value = patchData[i];
      }
    }
  }

  function sendMessage(){
    var patchParams = [];
    var portId = document.getElementById("midi_port_select").value;
    var channel = document.getElementById("midi_channel_select").value;
    var patchNumber = document.getElementsByName("patch_number").item(0).value;
    var output = midi.outputs.get(portId);

    // var nodesArray = Array.prototype.slice.call(document.querySelectorAll("div"));

    var patchName = document.getElementsByName("patch_name").item(0).value;

    for(var i = 0; i < 13; i++){
      if(patchName[i] == undefined){
        patchParams.push(0x20);
        patchParams.push(0x20);
      }
      else{
        patchParams.push(patchName[i]>>4);
        patchParams.push(patchName[i] & 0x0F);
      }
    }

    for(var i = 13; i < 237; i++){
      var input = document.querySelectorAll("input[data-id='"+i+"']");
      if(input == undefined){
        patchParams.push(0x00);
        patchParams.push(0x00);
      }
      else{
        patchParams.push(input.value >> 4);
        patchParams.push(input.value & 0x0F);
      }
    }
    output.send(sendPatch(channel, patchNumber, patchParams));
  }

  function onMIDIMessage( event ) {
    // if(event.data[0] != 0xb0 && event.data[0] != 0xe0){
    //   var str = "MIDI message received at timestamp " + event.timestamp + "[" + event.data.length + " bytes]: \n";
    //   for (var i=0; i<event.data.length; i++) {
    //     str += "0x" + event.data[i].toString(16) + ", ";
    //   }
    //   console.log( str );
    // }
    if(event.data[0] == 0xF0 && event.data[1] == 0x00 && event.data[2] == 0x00 && event.data[3] == 0x1B && event.data[4] == 0x02 && event.data[5] == 0x02 ){

      var dataCounter = 9;
      var eventData = Array.from(event.data);
      while(dataCounter < eventData.length) {
        patches.push(parsePatch( eventData.slice(dataCounter, dataCounter + 476) ) );
        dataCounter += 476;
      }
    }
  }

  function parsePatch(patchData) {
    var patch = {};
    var tmp = patchData.slice(0,26);
    patch.name = [];

    for(var i = 0; i < 26; i = i + 2) {
      patch.name.push( String.fromCharCode((tmp[i]<< 4) | tmp[i+1]));
    }
    patch.name = patch.name.join("");
    patch.attributes = patchData.slice(26);

    console.log("// " + patch.name);
    var str = "[ ";
    for (var i=0; i<patchData.length; i=i+2) {
      str += "0x" + ((patchData[i] << 4) | patchData[i+1]).toString(16) + ", ";
    }
    console.log( str + " ]\n");

    return patch;
  }

  function appendPortToList(port) {
    var option = document.createElement("option");
    option.value = port.id;
    option.innerText = port.type + "|" + port.manufacturer + "|" + port.name + "|" + port.version;
    document.getElementById("midi_port_select").appendChild(option);
  }

  function listInputsAndOutputs( midiAccess ) {
    midiAccess.outputs.forEach(appendPortToList);
    midiAccess.inputs.forEach(appendPortToList);
  }

  function appendLogMessage(message) {
    var logArea = document.getElementById("midi_log");
    var p = document.createElement("p");
    p.innerText = message;
    logArea.insertBefore(p, logArea.firstChild);
  }

  function onMIDISuccess( midiAccess ) {
    appendLogMessage("MIDI ready!");
    midi = midiAccess;
    listInputsAndOutputs(midiAccess);
  }

  function onMIDIFailure(msg) {
    appendLogMessage("Failed to get MIDI access - " + msg);
  }

  function sendPatch(channel, patchNumber, patchData) {
    receiveProgramCommandByte = 0x00;
    var header = new Uint8Array(9 + 237 + 1);

    header.set([0xF0, 0x00, 0x00, 0x1B, 0x02, 0x02], 0);
    header.set([channel], 6);
    header.set([receiveProgramCommandByte, patchNumber], 7);
    header.set( patchData, 9);
    header.set([0xF7], 237);

    return header;
  }

  function dumpPatch(channel, patchNumber) {
    dumpProgramCommandByte = 0x01;
    return [0xF0, 0x00, 0x00, 0x1B, 0x02, 0x02, channel, dumpProgramCommandByte, patchNumber, 0xF7];
  }

  document.getElementsByName("patch_number").item(0).addEventListener("change", function(){
    if(parseInt(this.value) < patches.length )
      loadPatch(parseInt(this.value));
  });

  if(navigator.requestMIDIAccess != undefined) {
    navigator.requestMIDIAccess( { sysex: true } ).then( onMIDISuccess, onMIDIFailure );
  } else {
    alert("Your browser is probably not supported. Please try Chrome.");
  }
});
